import React from "react";

import "./EmailBox.css";
import "../../App.css";

const EmailBox = () => {
  return (
    <>
      <section className="emailbox" id="emailbox">
        <div className="container d_flex">
          <div className="email_box box">
            <h1>helo</h1>
          </div>
        </div>
      </section>
    </>
  );
};

export default EmailBox;
